import "./App.css";
import { Route, Routes } from "react-router-dom";
// import BlogCard from "./components/BlogCard/BlogCard";
import HomePage from "../src/pages/HomePage/HomePage";
import LoginForm from "./components/LoginForm/LoginForm";
import SignUpForm from "./components/SignUpForm/SignUpForm";
import UsersInfo from "./pages/UsersInfoPage/UsersInfo";
import { useEffect, useState } from "react";
import axios from "axios";
import PublicBlogsPage from "../src/pages/PublicBlogsPage/PublicBlogsPage";

function App() {
  const [cardData, setCardData] = useState([]);
  const [usersList,setUsersList]=useS
  const getBlogs = async () => {
    const response = await axios.get(
      "http://localhost:8080/blog/get-all-blogs"
    );
    return response.data.blogs;
  };
  const blogs = async () => {
    const data = await getBlogs();
    setCardData(data);
  };
  console.log(cardData, "-------cardData");

  useEffect(() => {
    blogs();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage cardData={cardData} />}></Route>
        <Route path="/blogs" element={<PublicBlogsPage />}></Route>
        <Route path="/users" element={<UsersInfo />}></Route>
        <Route path="/login" element={<LoginForm />}></Route>
        <Route path="/signUp" element={<SignUpForm />}></Route>
      </Routes>
    </div>
  );
}

export default App;
